import React, { Component, useState } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Switch,
} from 'react-router-dom';
import NavBar from './NavBar';
import HomePage from './pages/HomePage';
import JobSearchList from './pages/JobSearchList';
import JobPage from './pages/JobPage';
import CreateNewVacancyPage from './pages/CreateNewVacancyPage';
import RegisterPage from './pages/RegisterPage';
import LoginPage from './pages/LoginPage';
import NotFoundPage from './pages/NotFoundPage';
import './App.css';


class App extends Component {
  render() {
    return(
        <Router>
        <div className="App">
          <NavBar />
          <div>
            <Switch>
              <Route path="/" component={HomePage} exact />
              <Route path="/vacancies/" component={JobSearchList} exact />
              <Route path="/vacancies/:name" component={JobPage} exact />
              <Route path="/add-new-vacancy/" component={CreateNewVacancyPage} exact />
              <Route path="/register/" component={RegisterPage} exact />
              <Route path="/login/" component={LoginPage} exact />
              <Route component={NotFoundPage} />
            </Switch>
          </div>
        </div>
      </Router>
    );
  }
}

export default App;
